import React from 'react';
function Header(){
    return(
        <div className="background"> 
            <div className="container">
                    <a href="/" className="container-logo">
                        <img src={process.env.PUBLIC_URL +"/logo.png"} alt="logo"></img>
                    </a>
                    <ul className="container-navbar">
                        <li><a href="/" className="container-navbar-link">Home</a></li>
                        <li><a href="/" className="container-navbar-link">Item</a></li>
                        <li><a href="/" className="container-navbar-link">Pet</a></li>
                    </ul>
                    <div className="container-auth">
                        <a href="/"className="navbar-login">Login</a>
                        <a href="/"className="navbar-cart">Cart</a>
                    </div>     
            </div>
           
        </div>
    )
};
export default Header;
